import PropTypes from 'prop-types';
import { withTranslation } from "react-i18next"
import { Link } from "react-router-dom"

import {
  Table,
  Card,
  CardBody,
  Pagination,
  PaginationItem,
  PaginationLink,
  CardFooter,
  Button,
  Row,
  Col,
} from "reactstrap"

const ResultadosBusqueda = (props) => {


  const dataRows = props.results.map((data) => (
    <tr key={data.id}>

      <td>{data.comment}</td>
      <td>
        <Button color="link" className="btn btn-link" title={props.t("View")}> <i className="mdi mdi-file-search-outline mdi-24px"></i>  </Button>
      </td>

    </tr>)
  );

  return (

    <Row>
      <Col lg="12">
        <div className="table-responsive">
          <Table className="table mb-0">
            <thead className="table-light">
              <tr>

                <th colSpan={2}> <h4 className="card-title">{props.t("LegalDocumentation")}</h4>
                </th>

              </tr>
            </thead>
            <tbody>
              {dataRows}
            </tbody>
          </Table>

        </div>
      </Col>
      <Col lg="12">

      </Col>
    </Row>


  );
}

ResultadosBusqueda.propTypes = {
  results: PropTypes.array.isRequired, //Resultado de la busqueda
}

export default (withTranslation()(ResultadosBusqueda));
